import { 
    Flex,
    Heading
} from '@chakra-ui/react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Logo = () => {
    return (
        <Flex
            alignItems="center"
        >
            <FontAwesomeIcon icon="fas fa-hammer" />
            <Heading size={['md', 'md', 'md', 'lg']} fontWeight={400}>
                Breakdown
            </Heading>
        </Flex>
    );
}

export default Logo;
